import React from 'react';
import { Card, Row, Col } from 'antd';

const Home = () => {
    const dummy = [
        {
            title: "DSM공모전",
            admin: "김주성",
            body: "공모전을 위한 클래스"
        }
    ]
    return (
        <div>
            <Row gutter={16}>
                {
                    dummy.map(v => {
                        return (
                            <Col span={4}>
                                <Card 
                                    title={v.title}
                                    cover={
                                        <img
                                          alt="example"
                                          src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
                                        />
                                      }
                                    > 
                                    {v.body}
                                </Card>
                            </Col>
                        )
                    })
                }
            </Row>
            
        </div>
    )
}

export default Home;
